VALUES ('NIH WWW: Heart', 'How the Heart Works Home < Back To Health TopicsHow the Heart Works 0 How the Heart Works MENU Home < Back To Health TopicsHow the Heart Works The Heart What the Heart Looks Like How Blood Flows through the Heart How the Heart Beats MORE INFORMATION Fact Sheets and Handouts How the Heart Works How the Heart Works The Heart Language switcherEnglishEspaol The heart is an organ about the size of your fist that pumps blood through your body. It is made up of multiple layers of tissue. Your heart is at the center of your circulatory system. This system is a network of blood vessels, such as arteries, veins, and capillaries, that carries blood to and from all areas of your body. Your blood carries the oxygen and nutrients that your organs need to work properly. Blood also carries carbon dioxide to your lungs so you can breathe it out. Inside your heart, valves keep blood flowing in the right direction. Your hearts electrical system controls the rate and rhythm of your heartbeat. A healthy heart supplies your body with the right amount of blood at the rate needed to work well. If disease or injury weakens your heart, your bodys organs will not receive enough blood to work normally. A problem with the electrical system  or the nervous or endocrine systems, which control your heart rate and blood pressure  can also make it harder for the heart to pump blood. brochure Explore some basic facts about keeping your heart healthy. Last updated on March 24, 2022', 'NIH_WWW', 'heart', 'https://www.nhlbi.nih.gov/health/heart', 'medical_information', '{"content_hash": "290a120578c2f5d7", "embedding_date": "2025-06-25T14:49:20.297963", "scraper_source": "NIH_WWW", "category": "government_health", "subcategory": "nih_www", "document_type": "medical_information", "published_date": "", "original_url": "https://www.nhlbi.nih.gov/health/heart"}', 1475);

