VALUES ('NIH WWW: Sleep', 'How Sleep Works Home < Back To Health TopicsHow Sleep Works 0 How Sleep Works MENU Home < Back To Health TopicsHow Sleep Works How Sleep Works Your Sleep/Wake Cycle Sleep Phases and Stages Why Is Sleep Important? How Much Sleep Is Enough? MORE INFORMATION Fact Sheets and Handouts Research How Sleep Works How Sleep Works How Sleep Works Language switcherEnglishEspaol Sleep is a period of rest that alternates with wakefulness. You have internal body clocks that control when you are awake and when your body is ready for sleep. These clocks have cycles of approximately 24 hours. The clocks are regulated by multiple factors, including light, darkness, and sleep schedules. Once asleep, you cycle through the stages of sleep throughout the night in a predictable pattern. Sleep is important because it affects many of your bodys systems. Not getting enough sleep or enough quality sleep raises your risk for heart and respiratory problems and affects your metabolism and ability to think clearly and focus on tasks. BOOKLET Your Guide to Healthy Sleep This booklet provides science-based information about sleep, as well as an overview of certain sleep disorders. View the booklet Last updated on March 24, 2022', 'NIH_WWW', 'sleep', 'https://www.nhlbi.nih.gov/health/sleep', 'medical_information', '{"content_hash": "f2fccee98eb1c87b", "embedding_date": "2025-06-25T14:49:20.416644", "scraper_source": "NIH_WWW", "category": "government_health", "subcategory": "nih_www", "document_type": "medical_information", "published_date": "", "original_url": "https://www.nhlbi.nih.gov/health/sleep"}', 1215);

