VALUES ('NIH WWW: Diabetes', 'Home Health Information Diabetes English English Espaol Diabetes Diabetes is a disease that occurs when your blood glucose, also called blood sugar, is too high. Over time, having too much glucose in your blood can cause other health problems such as heart disease, nerve damage, eye problems, and kidney disease. You can take steps to prevent or manage diabetes. According to the Centers for Disease Control and Preventions National Diabetes Statistics Report, an estimated 38.4 million people in the United States, or 11.6% of the population, have diabetes. About 1 in 5 adults with diabetes dont know they have the disease. An estimated 97.6 million American adults have prediabetes, which means their blood glucose levels are higher than normal but not high enough to be diagnosed as diabetes. Many areas of the body can be affected by diabetes. Learn about diabetes health problems. Featured Topics What is Diabetes? A1C Test & Diabetes Insulin Resistance & Prediabetes Nerve Damage (Diabetic Neuropathies) Healthy Living with Diabetes Low Blood Glucose (Hypoglycemia) Diabetes, Heart Disease, & Stroke Diabetic Kidney Disease Diabetes & Foot Problems Diabetes & Pregnancy Gestational Diabetes Preventing Diabetes after Pregnancy More Diabetes Topics Diabetes Basics What is Diabetes? Symptoms & Causes of Diabetes Risk Factors for Type 2 Diabetes Preventing Type 2 Diabetes Diabetes Tests & Diagnosis Managing Diabetes Insulin, Medicines, & Other Diabetes Treatments Healthy Living with Diabetes Preventing Diabetes Problems More Diabetes Basics Statistics Statistics for Diabetes in the United States Diabetes Topics A1C Test & Diabetes Artificial Pancreas Continuous Glucose Monitoring Diabetes & Foot Problems Diabetes & Pregnancy Diabetes & Sexual & Urologic Problems Diabetes, Gum Disease, & Other Dental Problems Diabetes, Heart Disease, & Stroke Diabetes Tests & Diagnosis Diabetic Eye Disease Diabetic Kidney Disease Financial Help for Diabetes Care Gestational Diabetes Healthy Living with Diabetes Insulin, Medicines, & Other Diabetes Treatments Insulin Resistance & Prediabetes Low Blood Glucose (Hypoglycemia) Managing Diabetes Monogenic Forms of Diabetes: Neonatal Diabetes & MODY Nerve Damage (Diabetic Neuropathies) Pancreatic Islet Transplantation Preventing Diabetes Problems Preventing Type 2 Diabetes Risk Factors for Type 2 Diabetes Symptoms & Causes of Diabetes Type 1 Diabetes Type 2 Diabetes What is Diabetes? Diabetes Discoveries & Practice Blog How To Treat Cardiovascular Disease in People with Diabetes More Blog Posts Community Health & Outreach Diabetes Alert Day National Diabetes Month More Community Health Resources Diabetes for Health Professionals Diabetes & Prediabetes Tests Game Plan for Preventing Type 2 Diabetes Diabetes School Guide Guiding Principles for the Care of People with or at Risk for Diabetes More Resources for Diabetes Health Professionals Clinical Trials Watch a video of NIDDK Director Dr. Griffin P. Rodgers explaining the importance of participating in clinical trials Research Discoveries & News NIH launches large study to tackle type 2 diabetes in young people Use of metformin in adults with diabetes linked to lower risk of long COVID Bariatric surgery provides long-term blood glucose control, type 2 diabetes remission Celebrating the 50th Anniversary of Diabetes Research Centers More Research News', 'NIH_WWW', 'diabetes', 'https://www.niddk.nih.gov/health-information/diabetes', 'medical_information', '{"content_hash": "e48d588f76b3b726", "embedding_date": "2025-06-25T14:49:20.510696", "scraper_source": "NIH_WWW", "category": "government_health", "subcategory": "nih_www", "document_type": "medical_information", "published_date": "", "original_url": "https://www.niddk.nih.gov/health-information/diabetes"}', 3374);

