VALUES ('NIH WWW: Kidney Disease', 'Home Health Information Kidney Disease English English Espaol Kidney Disease The kidneys are two bean-shaped organs. Each kidney is about the size of a fist. Your kidneys filter extra water and wastes out of your blood and make urine. Kidney disease means your kidneys are damaged and cant filter blood the way they should. You are at greater risk for kidney disease if you have diabetes or high blood pressure. If you experience kidney failure, treatments include kidney transplant or dialysis. Other kidney problems include acute kidney injury, kidney cysts, kidney stones, and kidney infections. Your Kidneys & How They Work Featured Topics Chronic Kidney Disease (CKD) Overview Preventing Chronic Kidney Disease Healthy Eating for Adults with Chronic Kidney Disease Quick Reference on UACR & GFR Kidney Failure Diabetic Kidney Disease IgA Nephropathy Polycystic Kidney Disease (PKD) Simple Kidney Cysts Kidney Infection (Pyelonephritis) Kidney Stones More Kidney Disease Topics Understanding Your Kidneys & CKD Common questions and brief answers about the kidneys, chronic kidney disease, and how to reduce your risk. Children & Youth Kidney Disease in Children Growth Failure in Children with Chronic Kidney Disease Helping Your Child Adapt to Life with Chronic Kidney Disease Nutrition for Chronic Kidney Disease in Children Kidney Stones in Children Hemolytic Uremic Syndrome in Children Multicystic Dysplastic Kidney Nephrotic Syndrome in Children IgA Vasculitis Kidney Disease Topics Chronic Kidney Disease Anemia in CKD Causes of CKD CKD Overview CKD Tests & Diagnosis Diabetic Kidney Disease Healthy Eating for Adults with CKD High Blood Pressure & Kidney Disease Managing CKD Mineral & Bone Disorder in CKD Preventing CKD Quick Reference on UACR & GFR Kidney Failure Eating & Nutrition for Hemodialysis Financial Help for Treatment of Kidney Failure Hemodialysis Kidney Failure Kidney Transplant Peritoneal Dialysis Other Kidney Topics Acquired Cystic 