VALUES ('NIH WWW: Liver Disease', 'Home Health Information Liver Disease English English Espaol Liver Disease The liver has many important functions, including digesting your food and processing and distributing nutrients. There are many kinds of liver diseases and conditions. Some, like hepatitis, are caused by viruses. Others can be the result of drugs or drinking too much alcohol. Long-lasting injury or scar tissue in the liver can cause cirrhosis. Jaundice, or yellowing of the skin, can be one sign of liver disease. Your Digestive System & How It Works Featured Topics Hepatitis A Hepatitis B Hepatitis C Autoimmune Hepatitis Nonalcoholic Fatty Liver Disease & NASH Nonalcoholic Fatty Liver Disease & NASH in Children Cirrhosis Hemochromatosis Biliary Atresia Liver Biopsy More Liver Disease Topics Clinical Trials Watch a video of NIDDK Director Dr. Griffin P. Rodgers explaining the importance of participating in clinical trials Research Discoveries & News Making New Connections to Address the Silent Epidemic of Nonalcoholic Fatty Liver Disease Research Aims to Triumph Against Childhood Liver Disease Limits on Acetaminophen in Acetaminophen-Opioid Combination Medications Affected Causes of Acute Liver Failure Disrupting talk amongst liver cells yields therapeutic targets for nonalcoholic fatty liver disease Optimizing treatment regimens for adults with chronic hepatitis B Complex Interplay Among Gut, Liver, and Microbes Underlies Metabolic Changes in Chronic Hepatitis C More Research News Liver Disease Topics Alagille Syndrome Autoimmune Hepatitis Biliary Atresia Cirrhosis ERCP Hemochromatosis Hepatitis A Hepatitis B Hepatitis C Hepatitis D Hepatitis E Hepatitis (Viral) Liver Biopsy Liver Transplant Nonalcoholic Fatty Liver Disease & NASH Nonalcoholic Fatty Liver Disease & NASH in Children Porphyria Primary Biliary Cholangitis (Primary Biliary Cirrhosis) Primary Sclerosing Cholangitis Wilson Disease Your Digestive System & How It Works', 'NIH_WWW', 'liver_disease', '