VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ental, and psychological factors play a role in depression. Where can I learn more about depression? Free health information Brochures and fact sheets with more information about depression, including signs, symptoms, and treatment options. Available for free in print and online. Science updates NIMH news about depression, including press releases and highlights on the latest research findings. Statistics Information about the prevalence and treatment of depression in the United States. Why is NIMH studying depression? Depression is one of the most common mental disorders in the United States. The symptoms range from mild to severe and can disrupt a persons ability to carry out everyday activities. It is linked to increased health care costs and other health conditions like heart disease and diabetes. It is also a risk factor for suicidal thoughts and behaviors. How is NIMH research addressing this critical topic?', '{-0.3814728856086731,-0.5383835434913635,0.5704128742218018,-0.628303587436676,-0.38903239369392395,0.6920334696769714,-0.31535521149635315,-0.11126561462879181,-0.18019944429397583,-0.5014322400093079,0.23903638124465942,0.19725759327411652,-0.32516953349113464,0.03691836819052696,-0.31832849979400635,0.21284803748130798,1.551116943359375,0.4812449514865875,0.03993241488933563,0.4309678077697754,-0.4940636157989502,-0.841971755027771,-0.5720651745796204,-0.907744288444519,0.004377936944365501,0.09901285916566849,-0.7219895720481873,-1.167594313621521,-0.4926651418209076,0.1808011829853058,-0.3441038429737091,0.15112264454364777,-0.037046611309051514,0.2818202078342438,-0.1205822080373764,-0.4693364202976227,-0.21951952576637268,0.3869951665401459,0.9077367782592773,-0.1103433221578598,-0.05008259788155556,-0.478585422039032,-0.43511977791786194,1.4667325019836426,-0.3379542827606201,0.15909817814826965,0.2428482323884964,0.32680171728134155,0.8819560408592224,-0.07445275783538818,0