VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'isk factor for suicidal thoughts and behaviors. How is NIMH research addressing this critical topic? NIMH is funding and conducting research to learn more about what causes depression, how it affects the brain, and how to treat it effectively. We''re working to improve existing treatments like medications, talk therapy (including telehealth and online options), and brain stimulation therapy.We''re investigating ways to identify which treatment will work best for a specific person and tailor treatments based on a person''s unique characteristics and traits. Were supporting research to develop and test therapies for people with treatment-resistant depression who dont improve after trying multiple treatment options. We are also exploring new methods to prevent and treat depression and improve the delivery of care for people living with depression.', '{-0.17537207901477814,0.034306373447179794,1.1254712343215942,-0.4697509706020355,0.06630515307188034,0.5915611982345581,-0.36583730578422546,-0.01155149471014738,-0.0744289830327034,-0.34261617064476013,0.3119416832923889,0.11510427296161652,-0.0875852033495903,-0.04636581614613533,-0.6817834377288818,0.08653534203767776,0.6649477481842041,0.13727958500385284,-0.029856912791728973,0.5655821561813354,-0.9906183481216431,-0.7916765213012695,-0.9213890433311462,-1.1924662590026855,-0.1218443214893341,-0.06914377212524414,-0.39377361536026,-0.8257510662078857,0.06140340119600296,0.7384008169174194,-0.446629136800766,0.12106209248304367,0.23708432912826538,0.39629966020584106,-0.06369980424642563,-0.5298888683319092,-0.37801721692085266,0.2625088691711426,0.9665365219116211,-0.2122623175382614,-0.09780554473400116,-0.5760015249252319,-0.6726464629173279,0.8715279698371887,-0.4086796045303345,-0.19831417500972748,0.12428196519613266,0.1688801795244217,0.8679108023643494,-0.1396484673023224,0.19962333142757416,-0.30879300832748413,-0.29265180230140686,0.9067