VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 1, 'ial anxiety disorderVarious phobia-related disorders Where can I learn more about anxiety disorders? Free health information Brochures and fact sheets with more information about anxiety disorders, including signs, symptoms, and treatment options. Available for free in print and online. Science updates NIMH news about anxiety disorders, including press releases and highlights on the latest research findings. Statistics Information about the prevalence and treatment of anxiety disorders in the United States. Why is NIMH studying anxiety disorders? About a third of U.S. adolescents and adults experience an anxiety disorder at some point in their lives. Anxiety disorder symptoms can interfere with daily life and routine activities, such as job performance, schoolwork, and relationships. In severe cases, a person might feel intense fear in common situations, avoid social encounters, or refuse to leave their home. How is NIMH research addressing this critical topic?', '{-0.6042050123214722,-0.5122153162956238,0.09734003245830536,-0.6432023048400879,0.26600754261016846,0.356119304895401,-0.21805918216705322,-0.25101643800735474,-0.5270645618438721,-0.9249435663223267,0.19296561181545258,0.5615972876548767,-0.10216718167066574,-0.6156573295593262,-0.5808340907096863,0.1119040697813034,0.49472498893737793,0.34173116087913513,-0.24646106362342834,0.5623630881309509,-0.08351542055606842,-0.8400999307632446,-0.6074746251106262,-0.31598472595214844,0.2599048614501953,-0.4059983193874359,-0.3070894479751587,-0.7109140753746033,-0.43783023953437805,0.31330960988998413,0.05708348751068115,-0.001826642663218081,-0.026113932952284813,0.021415283903479576,-0.18592804670333862,-0.6819886565208435,-0.14692367613315582,0.32379940152168274,0.08128570020198822,0.18384087085723877,0.09129246324300766,-0.273304283618927,-0.5304094552993774,0.46542391180992126,-0.2560277283191681,0.35204529762268066,0.1822240650653839,0.