VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'cial encounters, or refuse to leave their home. How is NIMH research addressing this critical topic? NIMH conducts and funds research to examine environmental and genetic factors that contribute to anxiety disorders. These include studies comparing brain development and biology among people with and without anxiety disorders. Our supported research also focuses on family and other environmental factors that may influence the risk for anxiety disorders in infants, children, adolescents, and adults.NIMH-supported research is examining rates and symptoms of anxiety disorders after major life events like pregnancy or after trauma or illness. Of particular interest are predictors and symptoms of anxiety disorders among youth, including during the college transition and in relation to social media use.Additionally, NIMH supports research on interventions and treatments for different types of anxiety disorders.', '{-0.37761276960372925,-0.1010393276810646,0.07885073125362396,-0.24379409849643707,0.1343536078929901,0.3452131450176239,-0.19241012632846832,0.07825484126806259,-0.2890510559082031,-0.477355420589447,0.2587610185146332,0.33668482303619385,0.072807177901268,-0.6939426064491272,-0.2570679485797882,0.0739845335483551,0.8816871643066406,0.2584076523780823,-0.09174852073192596,0.3910183906555176,-0.2617952227592468,-0.7071536779403687,-0.8487255573272705,-0.19493895769119263,0.052239496260881424,-0.4192427098751068,0.026108188554644585,-0.5888538956642151,-0.2813645005226135,0.4082750082015991,0.1276296079158783,-0.23882699012756348,-0.04451461508870125,0.10023556649684906,0.181618332862854,-0.4108140468597412,-0.2556901276111603,0.17925423383712769,0.16217894852161407,-0.25786787271499634,-0.07291696220636368,-0.8868709206581116,-0.6138691306114197,0.290047824382782,-0.627652108669281,0.2359272688627243,0.2887358069419861,0.4849259853363037,0.06943010538816452,0.11145345121622086,-0.361399859189